import { vehicleService as supabaseVehicleService, statisticsService } from './supabaseService';
import { supabase } from '../supabase/config';

// Cache simple en memoria
let vehicleCache = null;
let cacheTime = null;
const CACHE_DURATION = 30000; // 30 segundos

// Funci√≥n para limpiar cache
export const clearVehicleCache = () => {
  vehicleCache = null;
  cacheTime = null;
  console.log('üßπ Cache de veh√≠culos limpiado');
};

// Obtener todos los veh√≠culos
export const getVehicles = async (filters = {}) => {
  try {
    // Si no hay filtros y tenemos cache v√°lido, usarlo
    if (Object.keys(filters).length === 0 && vehicleCache && cacheTime && (Date.now() - cacheTime < CACHE_DURATION)) {
      console.log('üîÑ Usando cache de veh√≠culos');
      return vehicleCache;
    }
    
    console.log('üåê Consultando Supabase...');
    console.log('üîó URL base:', 'https://sdkrnuemobvxvifqecoz.supabase.co');
    console.log('üîë Usando clave anon');
    
    // Timeout aumentado para dar m√°s tiempo
    const timeoutPromise = new Promise((_, reject) => {
      setTimeout(() => reject(new Error('Timeout: Supabase tard√≥ m√°s de 15 segundos')), 15000);
    });
    
    // Debug: Verificar qu√© tenemos disponible
    console.log('üîç supabaseVehicleService:', supabaseVehicleService);
    console.log('üîç supabase:', supabase);
    
    // Usar directamente Supabase si el service est√° undefined
    const supabasePromise = supabaseVehicleService && supabaseVehicleService.getVehicles 
      ? supabaseVehicleService.getVehicles(filters)
      : supabase.from('vehicles').select('*');
      
    console.log('üîç supabasePromise creado:', !!supabasePromise);
    
    let result;
    try {
      const response = await Promise.race([supabasePromise, timeoutPromise]);
      
      // Si es respuesta directa de Supabase, extraer data
      if (response && response.data) {
        result = response.data;
      } else {
        result = response;
      }
      
      console.log('‚úÖ Datos obtenidos de Supabase:', result?.length || 0);
    } catch (timeoutError) {
      console.error('‚è∞ Timeout de Supabase:', timeoutError);
      // Si hay error, devolver array vac√≠o
      result = [];
    }
    
    // Solo cachear si no hay filtros
    if (Object.keys(filters).length === 0) {
      vehicleCache = result;
      cacheTime = Date.now();
    }
    
    return result;
  } catch (error) {
    console.error('Error obteniendo veh√≠culos:', error);
    throw error;
  }
};

// Obtener un veh√≠culo por ID
export const getVehicleById = async (id) => {
  try {
    return await supabaseVehicleService.getVehicleById(id);
  } catch (error) {
    console.error('Error obteniendo veh√≠culo:', error);
    throw error;
  }
};

// Crear nuevo veh√≠culo
export const createVehicle = async (vehicleData) => {
  try {
    return await supabaseVehicleService.createVehicle(vehicleData);
  } catch (error) {
    console.error('Error creando veh√≠culo:', error);
    throw error;
  }
};

// Actualizar veh√≠culo
export const updateVehicle = async (id, vehicleData) => {
  try {
    return await supabaseVehicleService.updateVehicle(id, vehicleData);
  } catch (error) {
    console.error('Error actualizando veh√≠culo:', error);
    throw error;
  }
};

// Eliminar veh√≠culo
export const deleteVehicle = async (id) => {
  try {
    return await supabaseVehicleService.deleteVehicle(id);
  } catch (error) {
    console.error('Error eliminando veh√≠culo:', error);
    throw error;
  }
};

// Obtener veh√≠culos destacados
export const getFeaturedVehicles = async (limit = 6) => {
  try {
    return await supabaseVehicleService.getFeaturedVehicles(limit);
  } catch (error) {
    console.error('Error obteniendo veh√≠culos destacados:', error);
    throw error;
  }
};

// Obtener veh√≠culos en promoci√≥n
export const getPromotionVehicles = async (limit = 6) => {
  try {
    return await supabaseVehicleService.getPromotionVehicles(limit);
  } catch (error) {
    console.error('Error obteniendo veh√≠culos en promoci√≥n:', error);
    throw error;
  }
};

// Obtener veh√≠culos similares
export const getSimilarVehicles = async (currentVehicle, limit = 4) => {
  try {
    return await supabaseVehicleService.getSimilarVehicles(currentVehicle, limit);
  } catch (error) {
    console.error('Error obteniendo veh√≠culos similares:', error);
    throw error;
  }
};

// Obtener estad√≠sticas de veh√≠culos
export const getVehicleStats = async () => {
  try {
    return await statisticsService.getStatistics();
  } catch (error) {
    console.error('Error obteniendo estad√≠sticas:', error);
    console.log('‚ö†Ô∏è  Sin conexi√≥n a base de datos - estad√≠sticas offline');
    // Devolver estad√≠sticas por defecto para que AdminPanel funcione
    return {
      totalVehicles: 0,
      totalViews: 0,
      featuredVehicles: 0,
      promotionVehicles: 0
    };
  }
};

// Funci√≥n helper para subir im√°genes a Supabase
export const uploadImage = async (file, vehicleId, imageIndex) => {
  try {
    return await supabaseVehicleService.uploadVehicleImage(file, vehicleId, imageIndex);
  } catch (error) {
    console.error('Error subiendo imagen:', error);
    throw error;
  }
};

// Funci√≥n helper para eliminar im√°genes
export const deleteImage = async (imageUrl) => {
  // Extraer path de la URL de Supabase
  const path = imageUrl.split('/storage/v1/object/public/vehicle-images/')[1];
  if (path) {
    const { deleteVehicleImage } = await import('../supabase/config');
    return await deleteVehicleImage(path);
  }
};
